INSERT INTO `block_custom` VALUES (1,'<p>Das ist der alleinige Sinn unserer Bürgerstiftung. Deren gemeinnütziger Zweck ist es, soziale, karikative, bildungsfördernde und kulturelle Projekte dort zu fördern, wo in Zeiten knapper öffentlicher Kassen notwendige Mittel fehlen.</p><p><a href=\"über-uns\" class=\"button-grey\">Weiterlesen &raquo;</a></p>','Bürger helfen Bürgern Info Box','filtered_html'),(2,'<p>Preiswürdig ist das besondere Engagement in der Nachbarschaft oder in der Gemeinde; für Kinder, Jugendliche, Ältere und Migranten; für Menschen mit Behinderungen; in der Frauenarbeit oder in der Umweltpolitik.</p>','Ehrenamtspreis Block','filtered_html'),(3,'<p>Bürgerstiftung für die Region Mosbach &nbsp;| &nbsp;Hauptstraße 16 &nbsp;| &nbsp;74821 Mosbach &nbsp;| &nbsp;Telefon 06261 / 804-200 &nbsp;| &nbsp;E-Mail: <a href=\"mailto:info@buergerstiftung-mosbach.de\">info@buergerstiftung-mosbach.de</a></p>','Kontakt Info für Footer','filtered_html');
