INSERT INTO `cache_filter` VALUES ('filtered_html::441ea423ca110aee55f0c111154e1f1fac695ace466fe57bbe6b6f8f0d80614b','<p>Preiswürdig ist das besondere Engagement in der Nachbarschaft oder in der Gemeinde; für Kinder, Jugendliche, Ältere und Migranten; für Menschen mit Behinderungen; in der Frauenarbeit oder in der Umweltpolitik.</p>\n',0,1338902737,0),('filtered_html::698038e4b74eb3127f10b356bb53c0d32c069e780bb4dfd1f6a4865d25f788ec','<p>Bürgerstiftung für die Region Mosbach  |  Hauptstraße 16  |  74821 Mosbach  |  Telefon 06261 / 804-200  |  E-Mail: <a href=\"mailto:info@buergerstiftung-mosbach.de\">info@buergerstiftung-mosbach.de</a></p>\n',0,1338902709,0),('filtered_html::7a6f53380b3fd53b02fd1e30e961a9f4a34da389888e51066833adfd5a8291e9','<p>Das ist der alleinige Sinn unserer Bürgerstiftung. Deren gemeinnütziger Zweck ist es, soziale, karikative, bildungsfördernde und kulturelle Projekte dort zu fördern, wo in Zeiten knapper öffentlicher Kassen notwendige Mittel fehlen.</p>\n<p><a href=\"über-uns\" class=\"button-grey\">Weiterlesen »</a></p>\n',0,1338902737,0);
